INSERT INTO `volunteering_opportunities` (`id`, `domain`, `vertical`, `activity`, `activity_details`, `skills`, `onsite_offsite`, `activity_place`, `partner_id`, `frequency`, `days`, `hours_per_week`, `no_volunteers`) VALUES
(1, 'Project Activities', 'Education', 'Make reading fun and enjoyable experience- Volunteer to conduct reading sessions', 'Conduct English Reading Sessions for a Primary level class in a uderprivileged School (with a Mobile Library)', 'Interaction with Children at school', 'Onsite', 'Hyderabad', 0, 'Once a Week ', 'Monday to Saturday', 2, 0),
(2, 'Project Activities', '', 'Volunteer Championing -Enroll Volunteers for UC activities and projects', 'You can track UC''s volunteering oppurutnites and spread the word about how volunteers can engage with UC.', 'Coordination between volunteers and UC team', 'Offsite', '', 0, '', '', 2, 0),
(3, 'Documentation', '', 'Support Innovation through documentation - Documentation of UC projects reports, Result certificates', 'UC provides comprehensive information to all the stake holders with regards to every project it supports. Volunteers can pick the project of their choice and help capture information related to project outcomes through onsite visits and subsequent documentation of the project.', 'Documentationn and analytical skills', 'Onsite ', '', 0, '', '', 2, 0),
(4, 'Documentation', '', 'Be the Eye for YouSee- Video Documentation of our work', 'UC supports projects in the fields of Health, Education and Environment. These projects are operational in various locations in India. We need volunteers who are passionate in visual documentation of Social Development work. This contribution will be vital in communicating our work better to various stakeholders.', 'Videography, Documenting, Editing', 'Onsite ', '', 0, '', '', 2, 0),
(5, 'Analytics', '', 'Accounting for accountability -Support in book keeping and analyze the financial statements', 'UC aims at extending its support to its implementing partners beyond financial support. Volunteers can help Prepare financial statements and analysis of projects and NGO partner books of accounts. This is will ensure delivery of essential administrative services provided very cost effectively.', 'Finance and Accounts', 'Offsite', '', 0, '', '', 2, 0),
(6, 'Analytics', 'Health', 'Crunching numbers for a cause -Analytics for HealthCare projects', 'UC is currently supporting Health Care project in Hyderabad and Tamil Nadu. We need volunteers to analyze data from these projects for generating insights in these Health Care projects.', 'Spreasheet skills(Excel) and using analytical tools', 'Offsite', 'Chennai, Hyderabad', 0, '', '', 2, 0),
(7, 'Social Media', '', 'Click like button for cause, post message for change- Enhacement of Social Media platform utilisation', 'We welcome volunteers to spread word about UC on the social networking platforms and also help us find apt applicatinos which help us optimize our presence on social networking sites.', 'Facebook, Twitter etc', 'Offsite', '', 0, '', '', 2, 0),
(8, 'Project Activities', 'Environment', 'Do Not Waste, Donate Your Waste -Conduct waste donation camp at office', 'Conduct waste donation drives and volunteer to introduce Green Index practices in your office space. We look forward for volunteers who are green enthusiasts and want to work on challenges related to waste management. ', '', 'Onsite', '', 0, '', '', 1, 0),
(9, 'Project Activities', 'Environment', 'Do Not Waste, Donate Your Waste -Conduct waste donation camp at Residential Colony/Apartment', 'Conduct waste donation drives and volunteer to introduce this unique campaign in your residential space. We look forward for volunteers who are green enthusiasts and want to work on challenges related to waste management. ', '', 'Onsite', '', 0, '', '', 1, 0),
(10, 'Project Activities', 'Environment', 'Set up C-Gardens (Compost Gardens) at your Residential Community or Office', 'Help set up Compost Centers at your Residential Community or Office, where all the Food and Garden waste can be composted to generate organic manure, rather than burning or transporting the waste to Landfills.', '', 'Onsite', '', 0, '', '', 0, 0),
(11, 'Project Activities', 'Environment', 'Volunteer to monitor and train garden staff at Public Gardens and Residential areas to manage their Compost Centers ', 'UC is supporting the set up of Compost Centers in Public Gardens, Residential and Non-Residential communities to reduce organic waste being mixed with other wastes and to avoid transportation to landfills. We invite Green Enthusiasts who will visit a few of these sites atleast once a week, to monitor and train the garden staff to manage the compost centers well.', 'Basic Composting Skills, Training', 'Onsite', 'Bhopal, Hyderabad, Indore', 0, '1', '', 2, 0),
(12, 'Technology', '', 'Your valuable time to manage our valuable data -Enhancements for Database applications using MySQL/PHP', 'We have several data base applications in place and have ideated for few more. We require volunteers who can enhance existing data base applications and develop few essential ones. These appllications are used to stregthen our relationships with our dnors, volunteers, project partners, interns etc.', 'MySQL, PHP, Google Chart APIs', 'Offsite', '', 0, '', '', 4, 0),
(13, 'Technology', '', 'Find us the right resource -Advice and support in use of open/free source IT applications', 'UC aims at leveraging some of the efficient open source platforms for project management purpose. We need volunteers with adequate knowledge about these tools who can help us integrated them in our operations.', 'Open/Free Source IT applications', 'Offsite', '', 0, '', '', 2, 0),
(14, 'Technology', '', 'Helping us connect better -Enhancement to UC website to improve user interface and visualisation of UC work and data', 'Given multiple projects in multiple location, UC has very diverse audience visiting the website for varied reasons. With your help, we intend to transform our website into one of the finest platforms for diseminating pertinent information using advanced opensource tools.', 'HTML, CSS, Javascript, Google Chart APIs', 'Offsite', '', 0, '', '', 4, 0),
(15, 'Project Activities', '', 'Know the learning pulse - Conduct baseline assesments of Childrens''s learning indicators in underpreviledged schools', 'UC interfaces with several NGO''s who work in education space. Before strengthening the engagement, UC conduccts base line assessment for target population of students in the concerned schools. Most of these schools are government schools. Through volunteering for this ativity you contribute to strengthen the public education system.', 'Ability to interact with children, knowing local language will be additional benefit.', 'Onsite', 'Hyderabad, Delhi', 0, '', 'Monday to Saturday', 2, 0),
(16, 'Technology', '', 'Contribute to our work by preventing loss of work -Preventive maintenance of IT equiptment for UC and NGO partners (including PCs and Laptops)', 'Need volunteers who can help UC and partnering organizations to reduce the downtime of systems and enhance their performance by taking up periodic preventinve maintenance interventions.', '', 'Offsite', '', 0, '', '', 2, 0),
(17, 'Technology', '', 'Trouble shooting for IT (systems and applications)  related issues', 'We need volunteers who can respond on need basis for providing support for system related issues. Requirements will come from both UC team and also UC partner organizations.', '', 'Offsite', '', 0, '', '', 2, 0),
(18, 'Technology', '', 'Data back up solutions implementation', 'Designing procedures for back ups, and providing archival solutions. Volunteers would need to oversee implementation.', '', 'Offsite', '', 0, '', '', 2, 0),
(19, 'Project Activities', 'Health', 'MRD monthly Reports and Graphical Analysis at Gandhi Hospital', '', '', 'Onsite', 'Hyderabad', 0, '', '', 2, 0),
